import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlusCircle, faTrash } from '@fortawesome/free-solid-svg-icons';
import { Grid, Input, InputLabel, Button, TextField } from '@material-ui/core';

export const Form = () => {
  return (
    <form>
      <Grid container>

        <Grid item xs={8} justify="center" alignItems="center">
          <TextField label="Todo" name="todo" />
        </Grid>

        <Grid item xs={2} justify="center" alignItems="center">
          <Button Button type="submit">
            <FontAwesomeIcon icon={faPlusCircle} color="green" />
          </Button>
        </Grid>

        <Grid item xs={2} justify="center" alignItems="center">
          <Button type="submit">
            <FontAwesomeIcon icon={faTrash} color="red" />
          </Button>
        </Grid>

      </Grid>
    </form>
  );
};
